/* Model update function */
void test_update(void)
{
  /* Update for Integrator: '<S14>/Integrator1' */
  test_DW.Integrator1_IWORK = 0;

  /* Update for Integrator: '<S15>/Integrator1' */
  test_DW.Integrator1_IWORK_i = 0;

  /* Update for Integrator: '<S10>/Integrator1' */
  test_DW.Integrator1_IWORK_g = 0;

  /* Update for Integrator: '<S11>/Integrator1' */
  test_DW.Integrator1_IWORK_d = 0;

  /* Update for Integrator: '<S12>/Integrator1' */
  test_DW.Integrator1_IWORK_gg = 0;

  /* Update for Integrator: '<S13>/Integrator1' */
  test_DW.Integrator1_IWORK_l = 0;

  /* Update for Integrator: '<S9>/Integrator1' */
  test_DW.Integrator1_IWORK_a = 0;
  if (rtmIsMajorTimeStep(test_M)) {
    rt_ertODEUpdateContinuousStates(&test_M->solverInfo);
  }

  /* Update absolute time for base rate */
  /* The "clockTick0" counts the number of times the code of this task has
   * been executed. The absolute time is the multiplication of "clockTick0"
   * and "Timing.stepSize0". Size of "clockTick0" ensures timer will not
   * overflow during the application lifespan selected.
   * Timer of this task consists of two 32 bit unsigned integers.
   * The two integers represent the low bits Timing.clockTick0 and the high bits
   * Timing.clockTickH0. When the low bit overflows to 0, the high bits increment.
   */
  if (!(++test_M->Timing.clockTick0)) {
    ++test_M->Timing.clockTickH0;
  }

  test_M->Timing.t[0] = rtsiGetSolverStopTime(&test_M->solverInfo);

  {
    /* Update absolute timer for sample time: [0.002s, 0.0s] */
    /* The "clockTick1" counts the number of times the code of this task has
     * been executed. The absolute time is the multiplication of "clockTick1"
     * and "Timing.stepSize1". Size of "clockTick1" ensures timer will not
     * overflow during the application lifespan selected.
     * Timer of this task consists of two 32 bit unsigned integers.
     * The two integers represent the low bits Timing.clockTick1 and the high bits
     * Timing.clockTickH1. When the low bit overflows to 0, the high bits increment.
     */
    if (!(++test_M->Timing.clockTick1)) {
      ++test_M->Timing.clockTickH1;
    }

    test_M->Timing.t[1] = test_M->Timing.clockTick1 * test_M->Timing.stepSize1 +
      test_M->Timing.clockTickH1 * test_M->Timing.stepSize1 * 4294967296.0;
  }
}

